/*Table structure for table `md_memu` */

DROP TABLE IF EXISTS `md_memu`;

CREATE TABLE `md_memu` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `key` varchar(255) DEFAULT NULL COMMENT 'url地址',
  `title` varchar(20) DEFAULT NULL COMMENT '名称',
  `icon` varchar(100) DEFAULT NULL COMMENT '图标',
  `parentid` int(11) DEFAULT '0' COMMENT '父ID',
  `addtime` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `md_memu` */

/*Table structure for table `md_patient_medicine` */

